import "./App.css";

function App() {
  return (
    <div className="App">
      <div>
        <label>Title</label>
        <input type="text" />

        <label>Author</label>
        <input type="text" />

        <label>Year</label>
        <input type="number" />

        <label>Image</label>
        <input type="text" />
      </div>
    </div>
  );
}

export default App;
